import React from "react";

class OrderDetails extends React.Component {

    constructor() {
        super();
        this.state = { test: 'Customer lists loading...', elements: [] }
      }

    componentDidMount() {
        this.getOrderDetails()
      }

      getOrderDetails() {
        var table = "";
        for (var i = 0; i < 5; i++) {
          table += `<section id="${i}"><p>
            ASMA Batool
            </p>`;
        }

        this.setState({
          test: <div dangerouslySetInnerHTML={{ __html: table }} />
        })
      } 

      render() {
        return (
          <React.Fragment>
           <div  className="flex-vertical" style={{marginLeft: "20px"}}>

           <header>
            <h1>Customer Details</h1>
          </header>

         {this.state.test}
             </div>      
          </React.Fragment>
        );
      }
    }

  export default OrderDetails;
